<div class="text-container"><span class="t s6" style="left:115px;bottom:1099px;">✓</span><span class="t s1" style="left:127px;bottom:1099px;letter-spacing:-0.01px;">100 % pour un bénéficiaire en catégorie BLEU MPR (très modestes) </span>
<span class="t s6" style="left:115px;bottom:1076px;">✓</span><span class="t s1" style="left:127px;bottom:1076px;letter-spacing:-0.01px;">80 % pour un bénéficiaire en catégorie JAUNE MPR (Modestes) </span>
<span class="t s6" style="left:115px;bottom:1053px;">✓</span><span class="t s1" style="left:127px;bottom:1053px;letter-spacing:-0.01px;">40 % pour un bénéficiaire en catégorie VIOLET MPR (Intermédiaires) </span>
<span class="t s6" style="left:115px;bottom:1030px;">✓</span><span class="t s1" style="left:127px;bottom:1030px;letter-spacing:-0.01px;">20 % pour un bénéficiaire en catégorie ROSE MPR (Supérieurs) </span>
<span class="t s1" style="left:69px;bottom:993px;letter-spacing:-0.01px;">Ces honoraires font l’objet d’un échéancier de paiement, selon les modalités suivantes : </span>
<span class="t s6" style="left:115px;bottom:953px;">✓</span><span class="t s1" style="left:127px;bottom:953px;letter-spacing:-0.01px;">Paiement des honoraires par l’ANAH en une seule fois à la fin de la mission de l’accompagnateur rénov </span>
<span class="t s1" style="left:69px;bottom:915px;letter-spacing:-0.01px;">La rémunération est due quelles que soient les contestations liées aux litiges entre le bénéficiaire et le(s) </span>
<span class="t s1" style="left:69px;bottom:897px;letter-spacing:-0.01px;">entreprise(s) de travaux provenant de circonstances imputables au bénéficiaire. </span>
<span class="t s3" style="left:69px;bottom:860px;letter-spacing:0.17px;">Article 8 : Rétractation </span>
<span class="t s1" style="left:69px;bottom:834px;letter-spacing:-0.01px;">Le Bénéficiaire a le droit de se rétracter du présent contrat sans donner de motif dans un délai de quatorze jours. Le </span>
<span class="t s1" style="left:69px;bottom:816px;letter-spacing:-0.01px;">délai de rétractation expire quatorze jours après le jour de la conclusion du contrat. </span>
<span class="t s1" style="left:69px;bottom:798px;letter-spacing:-0.02px;word-spacing:-0.21px;">Pour exercer le droit de rétractation, le Bénéficiaire doit notifier l’accompagnateur rénov ARCADIA AUDIT dont </span>
<span class="t s1" style="left:69px;bottom:780px;letter-spacing:-0.03px;word-spacing:-0.01px;">l’adresse est le 9 RUE DES COLONNES 75002 PARIS de sa décision de rétractation du présent contrat au moyen </span>
<span class="t s1" style="left:69px;bottom:761px;letter-spacing:-0.01px;">d'une déclaration dénuée d'ambiguïté (par exemple, lettre envoyée par la poste, télécopie). Le Bénéficiaire peut </span>
<span class="t s1" style="left:69px;bottom:743px;letter-spacing:-0.01px;">utiliser le modèle de formulaire de rétractation mais ce n'est pas obligatoire. Pour que le délai de rétractation soit </span>
<span class="t s1" style="left:69px;bottom:725px;letter-spacing:-0.01px;">respecté, il suffit que le Bénéficiaire transmette sa communication relative à l'exercice du droit de rétractation avant </span>
<span class="t s1" style="left:69px;bottom:707px;letter-spacing:-0.01px;">l'expiration du délai de rétractation </span>
<span class="t s1" style="left:69px;bottom:689px;letter-spacing:-0.01px;">Veuillez compléter et renvoyer le présent formulaire uniquement si vous souhaitez vous rétracter du contrat </span>
<span class="t s1" style="left:69px;bottom:656px;letter-spacing:-0.01px;">« A l'attention de : nom de la structure » </span>
<span class="t s1" style="left:69px;bottom:637px;letter-spacing:-0.01px;">« Adresse, code postal et ville » </span>
<span class="t s1" style="left:69px;bottom:619px;letter-spacing:-0.01px;">« Numéro de téléphone de la structure, de télécopieur et son adresse électronique » </span>
<span class="t s1" style="left:69px;bottom:601px;letter-spacing:-0.01px;">Je vous notifie par la présente ma rétractation du contrat portant sur la prestation de services ci-dessous : </span>
<span class="t s1" style="left:69px;bottom:583px;letter-spacing:-0.01px;">Mission d’accompagnateur rénov </span>
<span class="t s1" style="left:69px;bottom:565px;letter-spacing:-0.01px;">Commandé le : (date de signature du contrat d’accompagnement) </span>
<span class="t s1" style="left:69px;bottom:547px;letter-spacing:-0.01px;">Nom du bénéficiaire : </span>
<span class="t s1" style="left:69px;bottom:528px;letter-spacing:-0.01px;">Adresse du bénéficiaire : </span>
<span class="t s1" style="left:69px;bottom:510px;letter-spacing:-0.01px;">Signature du bénéficiaire (uniquement en cas de notification du présent formulaire sur papier) : </span>
<span class="t s1" style="left:69px;bottom:492px;letter-spacing:-0.01px;">Date : </span>
<span class="t s3" style="left:69px;bottom:455px;letter-spacing:0.17px;">Article 9 : Notification et élection de domicile </span>
<span class="t s1" style="left:69px;bottom:429px;letter-spacing:-0.01px;">Toute correspondance ou notification à adresser à l’accompagnateur rénov ou au bénéficiaire se feront à leur </span>
<span class="t s1" style="left:69px;bottom:411px;letter-spacing:-0.01px;">adresse de siège social ou de domicile définit ci-dessus. </span>
<span class="t s3" style="left:69px;bottom:374px;letter-spacing:0.19px;">Article 10 : Assurances </span>
<span class="t s1" style="left:69px;bottom:348px;letter-spacing:-0.02px;word-spacing:-0.21px;">ARCADIA AUDIT est assuré en responsabilité civile d’exploitation et en responsabilité décennal auprès de MIC </span>
<span class="t s1" style="left:69px;bottom:330px;letter-spacing:-0.01px;">INSURANCE, entreprise régie par le Code des assurances, société étrangère - Immatriculée sous le numéro dont le </span>
<span class="t s1" style="left:69px;bottom:312px;letter-spacing:-0.04px;word-spacing:-0.08px;">siège social est situé RUE DE L'AMIRAL HAMELIN 75116 PARIS. Numéro de police AXE2307097. </span>
<span class="t s3" style="left:69px;bottom:275px;letter-spacing:0.19px;">Article 11 : Traitement des données personnelles </span>
<span class="t s1" style="left:69px;bottom:249px;letter-spacing:-0.01px;">Les informations recueillies font l’objet d’un traitement informatique par l’accompagnateur rénov. L’accompagnateur </span>
<span class="t s1" style="left:69px;bottom:231px;letter-spacing:-0.01px;">rénov n’utilisera vos données que dans la mesure où cela est nécessaire pour le suivi de votre accompagnement, </span>
<span class="t s1" style="left:69px;bottom:213px;letter-spacing:-0.01px;">notamment le cas échéant pour le suivi de votre dossier auprès des organismes susceptibles d’accorder un </span>
<span class="t s1" style="left:69px;bottom:195px;letter-spacing:-0.01px;">financement. Conformément au règlement européen n°2016/679/UE du 27 avril 2016, le Bénéficiaire bénéficie d’un </span>
<span class="t s1" style="left:69px;bottom:176px;letter-spacing:-0.01px;">droit d’accès, un droit de limitation, d’un droit de rectification, d’un droit d’opposition, d’un droit à l’effacement, un </span>
<span class="t s1" style="left:69px;bottom:158px;letter-spacing:-0.01px;">droit à la portabilité aux informations le concernant, qu’il peut exercer en s’adressant par courrier à </span>
<span class="t s1" style="left:69px;bottom:140px;letter-spacing:-0.05px;word-spacing:-0.04px;">arcadia.audit@outlook.fr dont l’adresse est 9 RUE DES COLONNES 75002 PARIS. </span>
<span class="t s1" style="left:197px;bottom:75px;letter-spacing:-0.03px;word-spacing:0.01px;">ARCADIA AUDIT SASU au capital social 500,00 € - RCS Paris B 953 846 722 </span>
<span class="t s1" style="left:134px;bottom:56px;letter-spacing:-0.01px;">Code NAF ingénierie Études Techniques (7112B) - N° TVA intracommunautaire FR20953846722 </span>
<span class="t s5" style="left:254px;bottom:39px;letter-spacing:-0.13px;">N° d'Agréement Mon Accompagnateur Rènov' : MAR-75-0003108 </span></div>

